хм..знаете...я не могу сказать что то о себе... ну пишу стихи, рисую.. люблю закат и в чём то романтичен, а впрочем... это всё не так... я сам не понимаю... я очень разносторонен...постоянно смеюсь и глупо себя веду,стараясь рассмешить окружающих, но приходя домой сижу один, чтобы меня никто не трогал... если хочу плакать,держу всё в себе... а ведь так часто бывают такие порывы... надеюсь вы расскажете какой я на самом деле... есть лишь пара людей,перед которыми я открываюсь...и то наверное потому что никогда с ними не увижусь в жизни...


Мы смеёмся над смертью и покупаем килограммы таблеток в аптеке;
Мы говорим, что жизнь прекрасна и идём в магазин за ещё одной бутылкой водки;
Нам всё равно на общественное мнение, и мы постоянно спрашиваем: Как я выгляжу?;
Мы любим одиночество и крепко сжимаем в руке мобильник;
Мы уверены, что абсолютно спокойны и тянемся рукой к очередной сигарете;
Мы шокируем людей, но боимся сказать "ЛЮБЛЮ";
Мы не доверяем людям и, как минимум, раз в неделю плачемся кому-нибудь в жилетку;
Мы не верим в любовь и по ночам плачем в подушку;
Мы живём сегодняшним днём и строим планы на завтрашний;
Мы из принципа не смотрим новости по телевизору и читаем их в интернете
Мы очень самокритичны и любим только себя;
Мы прощаем себе все ошибки и косо смотрим на тех, кто их совершает;
Мы не верим в идеальных людей и каждый день в толпе высматриваем свой идеал;
Мы всегда говорим то, что думаем и почти разучились искренне улыбаться;
Мы хотим, чтобы люди принимали нас такими, какие мы есть и часами торчим перед зеркалом;
Мы любим умные фразы и не понимаем сами себя;
У нас куча нераскрытых таланов, и мы ничего не делаем для того, чтобы они раскрылись;
Мы ненавидим дни рождения и всегда их отмечаем;
Мы обожаем спать до полудня и ставим будильник на 6 утра;
Мы всегда добиваемся того, что хотим и боимся быть никому не нужными;
Мы пишем свои личные дневники и хотим, чтобы их читали;
Можно расправить крылья и улететь от всего этого навстречу ветру. Но у нас нет крыльев;
Мы говорим, что не чувствуем боли, но прокусываем губы до крови;
Мы говорим, что не умеем летать, а сами поправляем крылья за спиной;
Мы никогда не лжем, мы просто говорим не правду;
Мы не умеем плакать, а то, что течет по щекам лишь дождь;
Мы думаем, что мы свободны, не замечая цепей, что сковали нас;
Мы говорим: "Я сильная", когда боимся попросить помощи;
Мы верим в то, что Бог поможет нам, но сами давно считаемся атеистами;
Мы обижаемся, когда нас отвергают, но быстро забываем, когда бросаем сами;
Мы,гордо именуемся "Женщина", хотя часто сетуем, на то, что нам тяжело;
Мы говорим, что не ревнуем, а дома бьём посуду и режем вены;
Мы говорим, что любим, когда нам, что-то нужно;
Когда мы говорим "Прощай", нам так хочется сказать "Я хочу быть с тобой"...
И мы не пытаемся понять, для чего живем, мы просто существуем, как задумано
